import CardList from "./CardList";
import { robots } from "./robots";

const App = () => {
  return (
    <div>
      <h1>RoboFriends</h1>
      <input type="text" placeholder="Enter a robot name" />
      <CardList robot={robots} />
    </div>
  );
};
export default App;
